        const fetchMessage = async () => {

            const response = await fetch('/api/' + params.id)
            const json = response.json()

            if (response.ok) {

                setMessage(json)

            }

        }

        fetchMessage()
    });

    return (
        <div className="content">

            <p>{params.id}</p>

        </div>
    )

}

